INSERT INTO `questions` VALUES (988, 34, 1, 1, 0, 0, '<p>На наведеному малюнку зображено формат ТСР-заголовку:</p>\r\n<table border align="center">\r\n<tr><td>0 <td>1<td> 2<td> 3<td> 4<td> 5<td> 6<td> 7<td> 8<td> 9<td> 0<td> 1<td> 2<td> 3<td> 4<td> 5<td> 6<td> 7<td> 8<td> 9<td> 0<td> 1<td> 2<td> 3<td> 4<td> 5<td> 6<td> 7<td> 8<td> 9<td> 0<td> 1</tr>\r\n<tr><td colspan=16><center>Source Port</center><td colspan=16><center>Destination Port</center></tr>\r\n<tr><td colspan=32><center>Sequence Number</center></tr>\r\n<tr><td colspan=32><center>Acknowledgment Number</center></tr> \r\n<tr><td colspan=4><center>Data<br>Offset</center><td colspan=6><center><br>Reserved</center><td>U<br>R<br>G<td>A<br>C<br>K<td>P<br>S<br>H<td>P<br>S<br>T<td>S<br>Y<br>N<td>F<br>I<br>N<td colspan=16><center><br>Window</center></tr>\r\n<tr><td colspan=16><center>Checksum</center><td colspan=16><center>Urgent Pointer</center></tr>\r\n<tr><td colspan=24><center>Options</center><td colspan=8><center>Padding</center></tr>\r\n<tr><td colspan=32><center>Data</center></tr></table>\r\n<p>Яке призначення має поле: <b>Порт призначення (Destination Port)</b></p>');
INSERT INTO `questions` VALUES (989, 34, 1, 1, 0, 0, '<p>На наведеному малюнку зображено формат ТСР-заголовку:</p>\r\n<table border align="center">\r\n<tr><td>0 <td>1<td> 2<td> 3<td> 4<td> 5<td> 6<td> 7<td> 8<td> 9<td> 0<td> 1<td> 2<td> 3<td> 4<td> 5<td> 6<td> 7<td> 8<td> 9<td> 0<td> 1<td> 2<td> 3<td> 4<td> 5<td> 6<td> 7<td> 8<td> 9<td> 0<td> 1</tr>\r\n<tr><td colspan=16><center>Source Port</center><td colspan=16><center>Destination Port</center></tr>\r\n<tr><td colspan=32><center>Sequence Number</center></tr>\r\n<tr><td colspan=32><center>Acknowledgment Number</center></tr> \r\n<tr><td colspan=4><center>Data<br>Offset</center><td colspan=6><center><br>Reserved</center><td>U<br>R<br>G<td>A<br>C<br>K<td>P<br>S<br>H<td>P<br>S<br>T<td>S<br>Y<br>N<td>F<br>I<br>N<td colspan=16><center><br>Window</center></tr>\r\n<tr><td colspan=16><center>Checksum</center><td colspan=16><center>Urgent Pointer</center></tr>\r\n<tr><td colspan=24><center>Options</center><td colspan=8><center>Padding</center></tr>\r\n<tr><td colspan=32><center>Data</center></tr></table>\r\n<p>Яке призначення має поле: <b>Порт відправника (Source Port)</b></p>');
