INSERT INTO `questions` VALUES (1402, 104, 1, 1, 3, 0, '<P>Хост А (10.0.0.2/8) містить наступну таблицю маршрутизації\r\n<TABLE align=center border=1>\r\n<TBODY>\r\n<TR>\r\n<TD>Net</TD>\r\n<TD>Mask</TD>\r\n<TD>Gateway</TD>\r\n<TD>Interface</TD></TR>\r\n<TR>\r\n<TD>10.0.0.0</TD>\r\n<TD>255.0.0.0</TD>\r\n<TD>10.0.0.1</TD>\r\n<TD>10.0.0.2</TD></TR>\r\n<TR>\r\n<TD>0.0.0.0</TD>\r\n<TD>0.0.0.0</TD>\r\n<TD>10.0.0.1</TD>\r\n<TD>10.0.0.2</TD></TR></TBODY></TABLE></P>\r\n<P>Даний хост відправляє&nbsp;ICMP ехо-запит на хост В (10.0.0.3).</P>\r\n<P>Яке ICMP-повідомлення <STRONG>першим</STRONG> прийде у відповідь?</P>');
INSERT INTO `questions` VALUES (1403, 104, 1, 1, 5, 0, '<P>Локальній мережі працює два маршрутизатори R1 (10.0.0.1)&nbsp;та R2 (10.0.0.2), що містять настпні таблиці маршрутизації:<BR>R1</P>\r\n<TABLE border=1>\r\n<TBODY>\r\n<TR>\r\n<TD>Net</TD>\r\n<TD>Mask</TD>\r\n<TD>Gateway</TD>\r\n<TD>Interface</TD></TR>\r\n<TR>\r\n<TD>20.0.0.0</TD>\r\n<TD>255.0.0.0</TD>\r\n<TD>10.0.0.2</TD>\r\n<TD>10.0.0.1</TD></TR>\r\n<TR>\r\n<TD>10.0.0.0</TD>\r\n<TD>255.0.0.0</TD>\r\n<TD>10.0.0.1</TD>\r\n<TD>10.0.0.1</TD></TR></TBODY></TABLE>\r\n<P></P>\r\n<P>R2 \r\n<TABLE border=1>\r\n<TBODY>\r\n<TR>\r\n<TD>Net</TD>\r\n<TD>Mask</TD>\r\n<TD>Gateway</TD>\r\n<TD>Interface</TD></TR>\r\n<TR>\r\n<TD>20.0.0.0</TD>\r\n<TD>255.0.0.0</TD>\r\n<TD>20.0.0.1</TD>\r\n<TD>20.0.0.1</TD></TR>\r\n<TR>\r\n<TD>10.0.0.0</TD>\r\n<TD>255.0.0.0</TD>\r\n<TD>10.0.0.2</TD>\r\n<TD>10.0.0.2</TD></TR></TBODY></TABLE></P>Хост А (Адреса: 10.0.0.3/8, Default gateway: 10.0.0.1) відправляє ехо-запит на хост 20.0.0.10. Який пакет у відповідь першим надійде на хост А?');
