INSERT INTO `questions` VALUES (1496, 94, 1, 3, 0, 0, '<pre>Що надрукує наступний фрагмент?\r\nint a =520;\r\nswitch( a % 10 )\r\n{\r\n	case 0: cout <<  a% 10;\r\n	case 1: case 2: case 3: case 4: cout << a /10;\r\n	case 5: cout << a / 100; break;\r\n	default : cout << a; break;\r\n}</pre>');
INSERT INTO `questions` VALUES (1497, 97, 1, 2, 0, 1, '<PRE>#include &lt;iostream.h&gt;\r\nint hello(int x=4)\r\n{\r\n	static int c;\r\n	cout &lt;&lt; c;\r\n	return ++c;\r\n}\r\nint a=hello();\r\nint main()\r\n{\r\n	cout &lt;&lt; "Hello world !";\r\n	hello();\r\n	return 0;\r\n}</PRE>');
INSERT INTO `questions` VALUES (1498, 97, 1, 3, 2, 0, '<PRE>#include &lt;iostream.h&gt;\r\nvoid hello(int &amp;x, int y)\r\n{\r\n	for (;x&gt;y;x--)\r\n		cout &lt;&lt; ”Hello !”;\r\n}\r\nint main()\r\n{\r\n	int a=3?4:2;\r\n	hello(a,0);\r\n	cout &lt;&lt; a &lt;&lt; endl;\r\n	return 0;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1499, 97, 1, 2, 0, 1, '<PRE>#include &lt;iostream.h&gt;\r\nvoid hello(int x)\r\n{\r\n	for (;x--;)\r\n		cout &lt;&lt; x;\r\n}\r\nint main()\r\n{\r\n	int a=sizeof(int);\r\n	hello(a);\r\n	cout &lt;&lt; a &lt;&lt; endl;\r\n	return 0;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1500, 97, 1, 3, 1, 0, '<PRE>#include &lt;iostream.h&gt;\r\nint half(int x)\r\n{\r\n	int y=x/2;\r\n	cout &lt;&lt; ”y= ” &lt;&lt; y &lt;&lt; ” “;\r\n	return y;\r\n}\r\ndouble half(int x)\r\n{\r\n	double y=x/2.0;\r\n	cout&lt;&lt; ”y= ” &lt;&lt; y &lt;&lt; ” “;\r\n	return y;\r\n}\r\nint main()\r\n{\r\n	int a=half(9);\r\n	double b=half(9);\r\n	return 0;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1501, 97, 1, 1, 1, 1, '<PRE>#include &lt;iostream.h&gt;\r\nint x;\r\nint main()\r\n{\r\n	cout &lt;&lt; x &lt;&lt; ” “;\r\n	int x=1;\r\n	cout &lt;&lt; x &lt;&lt; ” “;\r\n	{\r\n		int x=100;\r\n		cout &lt;&lt; x &lt;&lt; ” “;\r\n	}\r\n	cout &lt;&lt; x &lt;&lt; ” “;\r\n}\r\n</PRE>');
