INSERT INTO `questions` VALUES (1503, 97, 1, 1, 0, 0, '<PRE>#include &lt;iostream.h&gt;\r\nint main()\r\n{\r\n	const unsigned int x=1;\r\n	cout &lt;&lt; x &lt;&lt; ” “;\r\n	{\r\n		int x;\r\n		x=100;\r\n		cout &lt;&lt; x &lt;&lt; ” “;\r\n	}\r\n	cout &lt;&lt; x &lt;&lt; ” “;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1504, 97, 1, 1, 0, 0, '<PRE>#include &lt;iostream.h&gt;\r\nvoid f(const int&amp; x)\r\n{\r\n	cout &lt;&lt; f2(x);\r\n	int f2()\r\n	{\r\n		return x++;\r\n	}\r\n}\r\nint main()\r\n{\r\n	int x=1;\r\n	f(x);\r\n	cout &lt;&lt; x;\r\n	return 0;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1505, 97, 1, 1, 0, 0, '<PRE>#include &lt;iostream.h&gt;\r\nint sqr(int x,int y)\r\n{\r\n	y=x*x;\r\n}\r\nint main()\r\n{\r\n	int x=1,y=0;\r\n	sqr(x,y);\r\n	cout &lt;&lt; x &lt;&lt; ” “ &lt;&lt; y;\r\n	return 0;\r\n}</PRE>');
INSERT INTO `questions` VALUES (1506, 97, 1, 1, 1, 1, '<PRE>#include &lt;iostream.h&gt;\r\nint my(int x,int &amp;y)\r\n{\r\n	x*=x;\r\n	return y=x;\r\n}\r\nint main()\r\n{\r\n	int x=1,y=0;\r\n	sqr(1,y++);\r\n	cout &lt;&lt; x &lt;&lt; ” “ &lt;&lt; y;\r\n	return 0;\r\n}\r\n</PRE>');
