INSERT INTO `questions` VALUES (1508, 97, 1, 1, 0, 1, '<PRE>#include &lt;iostream.h&gt;\r\nvoid Hello(int x[])\r\n{\r\n	cout &lt;&lt; ”x:” &lt;&lt; sizeof(x) &lt;&lt; ” “;\r\n}\r\nint main()\r\n{\r\n	static int x[5];\r\n	cout &lt;&lt; ”x:” &lt;&lt; sizeof(x) &lt;&lt; ” “;\r\n	Hello(x);\r\n	return 0;\r\n}</PRE>');
INSERT INTO `questions` VALUES (1509, 97, 1, 2, 0, 0, '<PRE>#include &lt;iostream.h&gt;\r\nvoid Hello(int *x,int n)\r\n{\r\n	cout &lt;&lt; n &lt;&lt; ” “ &lt;&lt; *x &lt;&lt; ” “;\r\n}\r\nint main()\r\n{\r\n	int x[10]={7,7,7};\r\n	Hello(x,sizeof(&amp;x[0]));\r\n	return 0;\r\n}</PRE>');
INSERT INTO `questions` VALUES (1510, 97, 1, 2, 0, 0, '<PRE>#include &lt;iostream.h&gt;\r\ndouble one(int x, double c=2)\r\n{\r\n	return x*c;\r\n}\r\nint one(double c=1,int x=0)\r\n{\r\n	return x+c;\r\n}\r\nint main()\r\n{\r\n	cout &lt;&lt; one() &lt;&lt; " " &lt;&lt; one(2) &lt;&lt; " " &lt;&lt; one(1.5,2);\r\n	return 0;\r\n}</PRE>');
