INSERT INTO `questions` VALUES (1533, 98, 1, 2, 0, 0, '<PRE>Що надрукує програма? \r\n#include &lt;iostream.h&gt;\r\nvoid main()\r\n{\r\n	char * ptr, *ptr2;\r\n	char a=''A'', b=''a'';\r\n	ptr=&amp;a; ptr2=&amp;b;\r\n	ptr2=ptr;\r\n	*ptr=*ptr+1;\r\n	b=*ptr+*ptr2-''A'';\r\n	cout &lt;&lt; a &lt;&lt; " " &lt;&lt; b &lt;&lt; endl;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1534, 98, 1, 2, 1, 0, '<PRE>Що надрукує програма? \r\n#include &lt;iostream.h&gt;\r\nvoid main()\r\n{\r\n	int a=1; int &amp;b=a;\r\n	int * c=&amp;b; int **d=&amp;c;\r\n	**d=a+b;\r\n	cout &lt;&lt; a &lt;&lt; ” “ &lt;&lt; b &lt;&lt; endl;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1535, 98, 1, 3, 0, 0, '<PRE>Що надрукує програма? \r\n#include &lt;iostream.h&gt;\r\nvoid main()\r\n{\r\n	char c[6]=”54321”;\r\n	char *ptr=c+2;\r\n	char *ptr2=++ptr;\r\n	*ptr2=''1'';\r\n	*(ptr+1)=*ptr-*ptr2+''7'';\r\n	*c=*++ptr2-1;\r\n	for(int i=0;i&lt;5;i++)\r\n		cout &lt;&lt; c[i];\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1536, 98, 1, 2, 0, 0, '<PRE>Що надрукує програма? \r\n#include &lt;iostream&gt;\r\nusing namespace std;\r\nvoid main()\r\n{\r\n	int * ptr, *ptr2;\r\n	int a=2, b=10;\r\n	ptr=&amp;b; ptr2=&amp;a;\r\n	ptr=ptr2;\r\n	*ptr=1;\r\n	b=*ptr-*ptr2;\r\n	cout &lt;&lt; a &lt;&lt; " " &lt;&lt; b &lt;&lt; endl;\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1537, 98, 1, 3, 0, 1, '<PRE>Що надрукує програма? \r\n#include &lt;iostream.h&gt;\r\nvoid main()\r\n{\r\n	int * ptr, *ptr2;\r\n	int c[5]={1,2,3,4,5};\r\n	ptr=c;\r\n	ptr2=ptr++;\r\n	*ptr2=0;\r\n	*ptr=100+ptr2-ptr;\r\n	*(ptr+2)=*ptr-*ptr2;\r\n	for(int i=0;i&lt;5;i++)\r\n		cout &lt;&lt; c[i] &lt;&lt; ” “;\r\n}</PRE>');
INSERT INTO `questions` VALUES (1538, 98, 1, 2, 0, 0, '<PRE>Що надрукує програма? \r\n#include &lt;iostream.h&gt;\r\nvoid Init(int * a, int n)\r\n{\r\n	a=new int [n];\r\n	for(int i=0;i&lt;n;*(a+i)=i++);\r\n}\r\nvoid Destroy(int * a)\r\n{\r\n	delete[]a;\r\n}\r\nvoid main()\r\n{\r\n	int * a;\r\n	Init(a,5);\r\n	for(int i=0;i&lt;5;i++) \r\n		cout &lt;&lt; a[i];\r\n	Destroy(a);\r\n}\r\n</PRE>');
INSERT INTO `questions` VALUES (1539, 98, 1, 3, 0, 0, '<PRE>Що надрукує програма? \r\n#include &lt;iostream.h&gt\r\nvoid Init(int * a, int n)\r\n{\r\n	int*end=a+n;\r\n	for(;a &lt; end;a++)\r\n	{\r\n		a[0]=end-a;\r\n	}\r\n}\r\nvoid main()\r\n{\r\n	int a[4]={0};\r\n	Init(a,4);\r\n	for(int i=0;i &lt; 4;i++) \r\n		cout &lt;&lt; *(a+i);\r\n}\r\n</PRE>');
