INSERT INTO `questions` VALUES (1832, 119, 1, 1, 0, 0, 'Злоумышленник использует узел В как ретранслятор датаграмм, направленных в А. Для этого он создает датаграмму, направленную из Х в В, в поле Protocol которой помещается значение 4 («IP»), а в качестве данных эта датаграмма несет другую IP-датаграмму, направленную из Х в А. Фильтрующий маршрутизатор пропускает сформированную датаграмму, поскольку она адресована разрешенному узлу В, а IP-модуль узла В извлекает из нее вложенную датаграмму. Видя, что вложенная датаграмма адресована не ему, узел В отправляет ее по назначению, то есть узлу А Описанная операция называется');
INSERT INTO `questions` VALUES (1833, 119, 1, 1, 0, 0, 'Узел А обменивается IP-датаграммами с узлом В, при этом узлы идентифицируют друг друга по IP-адресам, указываемым в датаграммах. Предположим далее, что узел В имеет особые привилегии при взаимодействии с А: то есть А предоставляет В некоторый сервис, недоступный для других хостов Интернета. Злоумышленник на узле Х, желающий получить такой сервис, должен имитировать узел В – такие действия называются');
INSERT INTO `questions` VALUES (1834, 119, 1, 1, 0, 0, 'Механизм реагирования на заторы сети (congestion control), реализуемый протоколом TCP (п. 1.2.5.4, RFC-2581), позволяет злоумышленнику-получателю данных принудить отправителя высылать данные с многократно увеличенной скоростью [Savage]. В результате злоумышленник отбирает для своих нужд ресурсы сервера-отправителя и компьютерной сети, замедляя или блокируя соединения прочих участников сетевого взаимодействия.');
INSERT INTO `questions` VALUES (1835, 119, 1, 1, 0, 0, 'Узел А находится в медленном старте после установления соединения. А отправляет в В один сегмент (SN=1-1000), но узел В, вместо того чтобы ответить подтверждением ACK SN=1001, отвечает серией сфабрикованных подтверждений ACK SN=1');
INSERT INTO `questions` VALUES (1836, 119, 1, 1, 0, 0, 'Получатель может заранее высылать подтверждения еще не принятых им, находящихся в пути сегментов, заставляя отправителя поверить, что данные уже доставлены, результатом чего будет увеличение cwnd и преждевременная отправка новых данных.');
INSERT INTO `questions` VALUES (1837, 119, 1, 1, 0, 0, 'Атаки большим числом формально корректных, но, возможно, сфальсифицированных пакетов, направленные на истощение ресурсов узла или сети;');
INSERT INTO `questions` VALUES (1838, 119, 1, 1, 0, 0, 'Атаки специально сконструированными пакетами, вызывающие общий сбой системы из-за ошибок в программах;');
INSERT INTO `questions` VALUES (1839, 119, 1, 1, 0, 0, 'Атаки сфальсифицированными пакетами, вызывающими изменения в конфигурации или состоянии системы, что приводит к невозможности передачи данных, сбросу соединения или резкому снижению его эффективности.');
INSERT INTO `questions` VALUES (1840, 119, 1, 1, 0, 0, 'Атака , которая состоит в генерации шквала ICMP Echo-ответов, направленных на атакуемый узел. Для создания шквала злоумышленник направляет несколько сфальсифицированных Echo-запросов от имени жертвы на широковещательные адреса нескольких сетей, которые выступят в роли усилителей.');
INSERT INTO `questions` VALUES (1841, 119, 1, 1, 0, 0, 'Распространенная атака , которая состоит в посылке злоумышленником SYN-сегментов TCP на атакуемый узел в количестве большем, чем тот может обработать одновременно (это число невелико – обычно несколько десятков).');
INSERT INTO `questions` VALUES (1842, 119, 1, 1, 0, 0, 'Атака состоит в затоплении атакуемой сети шквалом UDP-сообщений. Для генерации шквала злоумышленник использует сервисы UDP, посылающие сообщение в ответ на любое сообщение.');
INSERT INTO `questions` VALUES (1843, 119, 1, 1, 0, 0, 'Атака состоит в посылке на атакуемый узел фрагментированной датаграммы, размер которой после сборки превысит 65 535 октетов.');
INSERT INTO `questions` VALUES (1844, 119, 1, 1, 0, 0, 'Атака использует ошибку, возникающую при подсчете длины фрагмента во время сборки датаграммы.');
INSERT INTO `questions` VALUES (1845, 119, 1, 1, 0, 0, 'Атака состоит в посылке на атакуемый узел SYN-сегмента TCP, у которого IP-адрес и порт отправителя совпадают с адресом и портом получателя.');
INSERT INTO `questions` VALUES (1846, 119, 1, 1, 0, 0, 'Атака состоит в посылке на атакуемый TCP-порт срочных данных (задействовано поле Urgent Pointer). Атака поражала через порт 139 Windows-системы, в которых в прикладном процессе не была предусмотрена возможность приема срочных данных, что приводило к краху системы.');
INSERT INTO `questions` VALUES (1847, 119, 1, 1, 0, 0, 'Если хост получает маску для своей сети через ICMP-сообщение Address Mask Reply, то, сформировав ложное сообщение с длинной маской (например, 255.255.255.252), злоумышленник существенно ограничит способность атакуемого хоста к соединениям (коннективность).');
INSERT INTO `questions` VALUES (1848, 119, 1, 1, 0, 0, 'Если узел А установил соединение с узлом В, то злоумышленник может принудить узел А преждевременно закрыть это соединение. Для этого злоумышленник может послать узлу А от имени В сфальсифицированный RST-сегмент или ICMP-сообщение Destination Unreachable.');
INSERT INTO `questions` VALUES (1849, 119, 1, 1, 0, 0, 'Отправка узлу А от имени промежуточного маршрутизатора ложного сообщения ICMP Source Quench. RFC-1122 утверждает, что уровень IP должен проинформировать модуль TCP о получении этого сообщения, а последний обязан отреагировать уменьшением скорости отправки данных, причем рекомендуется, чтобы модуль TCP перешел в режим медленного старта, как после срабатывания таймера повторной передачи.');
INSERT INTO `questions` VALUES (1850, 119, 1, 1, 0, 0, 'Отправка узлу А от имени промежуточного маршрутизатора ложных сообщений ICMP Destination Unreachable: Datagram Too Big. При использовании алгоритма Path MTU Discovery модуль TCP, получая такие сообщения, будет уменьшать размер отправляемых сегментов до числа, указанного в ICMP-сообщении, или пока не достигнет установленного минимума. Если строго следовать стандарту, то минимальный размер датаграммы, которую любой модуль IP обязан передать без фрагментации, – 68 октетов. В этом случае, если в IP- и TCP-заголовках не используется опций, полезная нагрузка составит 28 октетов на сегмент. Кроме того, при получении сообщения Datagram Too Big включается режим медленного старта, хотя и без уменьшения значения окна cwnd.');
INSERT INTO `questions` VALUES (1851, 119, 1, 1, 0, 0, 'Отправка узлу А от имени узла В ложных дубликатов TCP-подтверждений. Таким образом злоумышленник вынудит узел А, во-первых, включить алгоритм быстрой повторной передачи и посылать заново уже полученные узлом В сегменты, во-вторых, – перейти в режим устранения затора, уменьшив скорость отправки данных');
INSERT INTO `questions` VALUES (1852, 119, 1, 1, 0, 0, 'Когда хакер, находящийся внутри корпорации или вне ее выдает себя за санкционированного пользователя – называется');
INSERT INTO `questions` VALUES (1853, 119, 1, 1, 0, 0, 'Данные шифруются 64-битными блоками на основе 56-битного ключа (ключ 64-битный, но используются в нем только 56 бит). Для расшифровки используется тот же ключ.');
INSERT INTO `questions` VALUES (1854, 119, 1, 1, 0, 0, 'Длинна обрабатываемых блоков - 64 бит. Число раундов - 16. Считается одним из наиболее сильных криптоалгоритмов. Для выработки ключей используется 521 цикл шифрования, что значительно затрудняет атаку приямым перебором. Эта же особенность делает затруднительной и возможность применения алгоритма в системах, где ключи меняются очень часто.');
INSERT INTO `questions` VALUES (1855, 119, 1, 1, 0, 0, 'Простой и быстрый криптоалгоритм. Автор -  Joan Daemen. Длинна ключа 96 бит. Длинна обрабатываемых блоков данных также 96 бит. David Wagner, John Kelsey, и Bruce Schneier открыли так называемуя related key атаку, которая требует всего 1 связанного запроса и 222 известных символа. Алгоритм не запатентован.');
INSERT INTO `questions` VALUES (1856, 119, 1, 1, 0, 0, 'Алгоритм очень похож на Blowfish. Длинна ключа 40...64 бит. Количество проходов 8. Известна related key атака на 64-битный CAST, открытая David Wagner, John Kelsey, и Bruce Schneier. Других атак кроме прямого перебора нет. Вариант алгоритма CAST-256 был выставлен на конкурс AES, но до финала не дошел.');
INSERT INTO `questions` VALUES (1857, 119, 1, 1, 0, 0, 'Алгоритм, который используется в сотовых телефонах для шифрования служебных каналов. Был взломан by David Wagner, John Kelsey, and Bruce Schneier of Counterpane Systems.');
INSERT INTO `questions` VALUES (1858, 119, 1, 1, 0, 0, 'Создан в исследовательской лаборатории корпорации IBM (1972-1975 годы) под руководством д-ра У. Тачмена. Длинна ключа 56 бит (64, но 8 из них не используются). Размер блока 64 бит. Число раундов - 16. Является симметричным алгоритмом.');
